Inclusion Criteria:

* Obtain written informed consent before implementing any trial-related procedures;
* Aged \>= 18 years old;
* Patients with locally advanced (stage IIIB/IIIC), metastatic, or recurrent (stage IV) NSCLC confirmed by histology or cytology, who are not candidates for surgical treatment and cannot undergo curative radiotherapy or chemotherapy according to the 8th edition of the TNM staging classification by the International Association for the Study of Lung Cancer and the American Joint Committee on Cancer;
* Absence of the following gene mutations: EGFR gene, ALK fusion oncogene, ROS1, etc. For other types of gene mutations, patients without approved targeted therapies are allowed to be included;
* Cohort 1: Patients with non-small cell lung cancer who have developed acquired resistance to PD-1 inhibitors (alone or in combination with another systemic therapy) after being responsive to treatment (for 6 months or more) can participate in this study. Cohort 2: Patients who have not received any systemic anti-tumor treatment for advanced/metastatic disease before; for patients who have previously received platinum-based adjuvant chemo/radiotherapy, neoadjuvant chemo/radiotherapy, or curative radiotherapy for advanced disease, disease progression occurred more than 6 months after the last treatment, they can participate in this study;
* The investigator confirms at least one measurable lesion according to RECIST 1.1 criteria;
* Estimated life expectancy \>= 3 months;
* ECOG PS: 0-1 score;
* Provide archived tumor tissue (including formalin-fixed paraffin-embedded tissue blocks containing tumor \[preferred\] or approximately 15 freshly cut unstained tissue sections) for confirmation of immunohistochemistry for PD-L1, CCR8, CCL1, FOXP3, etc. If archived tissue cannot be obtained, subjects must agree to undergo a tumor biopsy during the screening period;
* Hematological function is sufficient, defined as absolute neutrophil count \>= 1.5×10\^9 /L, platelet count \>= 100×10\^9 /L, hemoglobin \>= 90g/L (no history of transfusion within 7 days);
* Liver function is sufficient, defined as total bilirubin level \<= 1.5 times the upper limit of normal (ULN) and aspartate aminotransferase (AST) and alanine aminotransferase (ALT) levels \<= 2.5 times ULN for all patients, or for patients with liver metastases, AST and ALT levels \<= 5 times ULN;
* Renal function is sufficient, defined as serum creatinine \<= 1.5 times ULN;
* Coagulation function is sufficient, defined as international normalized ratio (INR) or prothrombin time (PT) \<= 1.5 times ULN; if the subject is receiving anticoagulant therapy, INR/PT within the range specified by the anticoagulant drug is acceptable;
* Childbearing-age women must have a negative pregnancy test within 7 days before starting treatment; and reliable contraception measures (such as intrauterine devices, contraceptive pills, and condoms) should be used within 30 days of the start and end of the trial. Childbearing-age male subjects should use condoms for contraception during the trial and for 30 days after the end of the trial;
* Cooperate with regular follow-up visits and comply with the requirements of the trial.

Exclusion Criteria:

* Prior use of CCR8 drugs or other unapproved investigational drugs or treatments;
* Known history of intolerance to PD-1 inhibitor therapy;
* Receipt of any approved systemic anti-cancer therapy or systemic immunostimulant treatment within 28 days prior to the start of the study treatment;
* Use of traditional Chinese medicine or immunomodulatory drugs with anti-tumor indications within the first 2 weeks prior to first dosing;
* History of allergic reactions to any components of the investigational drug;
* Known presence of brain metastases. Patients judged by the investigator to have stable brain metastases may be enrolled;
* Active hemoptysis, active diverticulitis, intra-abdominal abscess, gastrointestinal obstruction, or peritoneal metastasis requiring clinical intervention;
* Clinically uncontrollable pleural effusion/ascites (patients who do not require fluid drainage or have no significant increase in fluid for 3 days may be enrolled);
* Tumor compression of vital organs (such as esophagus) with associated symptoms, compression of superior vena cava, or invasion of major mediastinal vessels, heart, etc.;
* Severe comorbidities such as a history of severe pulmonary or cardiac disease, any arterial thrombosis, embolism, or ischemia occurring within 6 months prior to enrollment, such as myocardial infarction, unstable angina, cerebrovascular accident, or transient ischemic attack. History of deep vein thrombosis, pulmonary embolism, or any other severe thromboembolic event within 3 months prior to enrollment;
* Receipt of systemic corticosteroids (\> 10 mg/day prednisone or equivalent) or other systemic immunosuppressive agents (including but not limited to prednisone, dexamethasone, cyclophosphamide, azathioprine, methotrexate, thalidomide, and anti-tumor necrosis factor \[anti-TNF\] drugs) within 2 weeks prior to enrollment. The use of topical, ocular, intra-articular, intranasal, and inhaled corticosteroids is allowed;
* History of autoimmune diseases, including but not limited to myasthenia gravis, myositis, autoimmune hepatitis, systemic lupus erythematosus, rheumatoid arthritis, inflammatory bowel disease, vasculitis associated with antiphospholipid syndrome, Wegener's granulomatosis, Sjögren's syndrome, Guillain-Barré syndrome, multiple sclerosis, vasculitis, or glomerulonephritis. Patients with autoimmune-related hypothyroidism receiving stable doses of thyroid hormone replacement therapy are eligible to participate in this study. Patients with type 1 diabetes controlled with a stable insulin regimen are eligible to participate in this study;
* Active systemic infections, including tuberculosis (clinically diagnosed based on clinical history, physical examination, and radiological findings, as well as TB tests performed according to local medical practice), hepatitis B (known positive for HBV surface antigen \[HBsAg\], and HBV DNA \>= 1000 cps/ml or its lower limit of reference), hepatitis C, or human immunodeficiency virus (HIV antibody positive);
* Known presence of psychiatric disorders or substance abuse that may affect compliance with trial requirements;
* Recent use of a full therapeutic dose of oral or non-oral anticoagulants or thrombolytic agents. Prophylactic use of anticoagulants is allowed;
* History, disease, treatment, or laboratory abnormalities that may interfere with trial results, hinder the subject's full participation in the study, or are deemed by the investigator to be not in the subject's best interest to participate in the study.

Inclusion Criteria:

1. Fully understand this trial and voluntarily sign the informed consent form;
2. Advanced solid tumors diagnosed by histology or cytopathology;
3. Be able to provide archived (within 2 years after the first treatment with study drug) or fresh tumor tissue samples for relevant biological sample analysis required by the protocol;
4. At least one measurable lesion according to RECIST Version 1.1 (patients with only brain lesion as target lesion are not accepted);
5. Eastern United States Oncology Assistance Group (ECOG) performance status score of 0 or 1;
6. The expected survival time is more than 3 months;
7. Adequate organ and bone marrow function
8. Females of childbearing potential must have a negative blood pregnancy test within 7 days prior to the first dose of investigational product and be non-lactating; Eligible patients of childbearing potential (male and female) must agree to use a reliable method of contraception (hormonal or barrier method or abstinence) with their partner for at least 6 months from signing informed consent until after the last dose of study drug. Women of non-childbearing potential may not undergo pregnancy test and contraception (postmenopausal for at least 1 year or surgically sterilized).

Exclusion Criteria:

1. Patients with imaging findings showing tumor invasion of great vessels or unclear demarcation from blood vessels;
2. Patients with combined brain metastasis, meningeal metastasis, spinal cord compression or leptomeningeal disease;
3. Previous treatment with monoclonal antibodies, bispecific antibodies, small molecule compounds and cells targeting CCR8 at any time;
4. Conditions may significantly affect the autoimmune status;
5. Patients with serious, uncontrolled and unrecoverable acute and chronic diseases:
6. Subjects with other malignant tumors within 5 years prior to the first dose of the investigational drug ;
7. Subjects who have undergone major organ surgery (excluding aspiration biopsy) within 4 weeks prior to the first dose of study drug, or have experienced significant trauma, or require elective surgery during the trial;

Inclusion Criteria:

1. Age 18-75 years old (including boundary value), no gender limit;
2. ECOG score 0-1;
3. Expected survival ≥3 months;
4. Unresectable or metastatic or postoperative recurrent, histologically confirmed advanced triple-negative breast cancer. Triple-negative breast cancer is defined as: ER, PR and HER2 are negative. ER-negative and PR-negative are defined as tumors without positive staining, the proportion of cells in all tumor cells is \<1%; HER2-negative is defined as: HER2 (0), HER2 (1+) or HER2 (2+) detected by immunohistochemistry but negative by fluorescence in situ hybridization (FISH); Cohort 2 requires histological confirmation of PD-L1 CPS ≥ 1;
5. Cohort 1 : at least one prior line at recurrence or metastasis setting with disease progression or intolerable toxicity. In this situation, patients are allowed to be enrolled: the time between the last intravenous dose of adjuvant chemotherapy and first recurrence or metastasis is ≤6 months. Cohort 2: no prior line at recurrence or metastasis setting is allowed, the time between the last intravenous dose of adjuvant chemotherapy and first recurrence or metastasis ≥12 months.;
6. Provide sufficient fresh tissue specimens for biomarker analysis before treatment;
7. According to RECISTv1.1 standard, there is at least 1 measurable lesion;
8. Appropriate bone marrow and organ function before first dose :

   * Bone Marrow: Platelets ( PLT ) ≥ 90 × 109 /L , absolute neutrophil count ( ANC ) ≥ 1.5 × 109 /L , hemoglobin ≥ 9 g/dL ;
   * Coagulation: INR ≤ 1.5 , APTT ≤ 1.5 × ULN ;
   * Liver function: Liver function is basically normal, total bilirubin ≤ 1.5 × ULN ( total bilirubin in patients with Gilbert syndrome ≤ 3 × ULN can be enrolled), AST and ALT ≤ 2.5 × ULN (if there is liver metastasis, AST , ALT ≤ 5 × ULN );
   * Renal function: serum creatinine ≤ 1.5 × ULN or creatinine clearance ≥ 50 mL/min (according to Cockcroft-Gault formula);
   * Cardiac function: left ventricular ejection fraction ( LVEF ) ≥ 50% ; female QT interval ( QTcF ) ≤ 470 ms , male ≤ 450 ms .
9. Be able to well communicate with the investigator and understand and comply with the requirements of this study.

Exclusion Criteria:

1. Cohort 1 : Previous use of eribulin and CCR8- targeting drugs; Cohort 2: previous use of CCR8-targeting drugs and nab-paclitaxel, unless the interval between the last dose of nab-paclitaxel in the adjuvant chemotherapy and first recurrence or metastasis is ≥12 months;
2. Have received radiotherapy, chemotherapy, traditional Chinese medicine with anti-tumor indications, and local therapy (interventional therapy but not including tumor biopsy, ablation therapy, etc.) within 2 weeks before trial drug treatment;
3. Adverse events from previous anti-tumor treatments have not recovered to ≤ grade 1 according to CTCAE v5.0 (except for ≤ grade 2 toxicities judged by the investigator to have no safety risk, such as alopecia, long-term toxicity caused by radiotherapy, etc.);
4. Patients with known brain metastases. Those with stable brain metastases can be enrolled;
5. Third space effusion that is clinically uncontrollable and unsuitable for enrollment;
6. Participants with≥ grade 3 allergies to antibody drugs previously;
7. Taking systemic corticosteroids (\>10 mg daily prednisone or equivalent dose) or other systemic immunosuppressive drugs (including but not limited to prednisone, dexamethasone, cyclophosphamide, azathioprine, methotrexate , thalidomide, and anti-tumor necrosis factor drugs), topical, ocular, intra-articular, intranasal, and inhaled corticosteroids are allowed;
8. Subjects with a known history of autoimmune diseases, including but not limited to myasthenia gravis, myositis, autoimmune hepatitis, systemic lupus erythematosus, rheumatoid arthritis, Guillain-Barre syndrome, multiplex syndrome sclerosis or glomerulonephritis, except autoimmune-related hypothyroidism treated with stable dose of hormone;
9. Known idiopathic pulmonary fibrosis, organizing pneumonia (e.g., bronchiolitis obliterans), drug-induced pneumonia, idiopathic pneumonia, interstitial lung disease, severe radiation pneumonitis, or subjects with evidence of active pneumonia by chest CT scan screening.

Inclusion Criteria:

1. Subjects ≥ 18 years of age on the day of signed informed consent, male or female, and willing to follow study procedures;
2. ECOG score of 0 \~ 1;
3. Patients with resectable clinical stage II-IIIB (N2 only) NSCLC prior to neoadjuvant as assessed by the investigator (AJCC 8th ed.) and who are receiving 3 to 4 courses of standard PD-1 monoclonal antibody in combination with chemotherapy (platinum-containing two-agent chemotherapy) as neoadjuvant therapy during the neoadjuvant phase
4. Pathological evaluation of tumor for MPR (less than 10% residual tumor cells from the primary tumor) and specific remission rate (1 - residual tumor/primary tumor)
5. Subjects must have had complete resection of the NSCLC (no residual tumor and all surgical margins negative)
6. Histologically or cytologically confirmed squamous or non-squamous NSCLC.

Exclusion Criteria:

1. Subjects who have undergone segmental lung resection or wedge resection only, and subjects who have not undergone systemic or lobe-specific lymph node dissection;
2. Postoperative treatment with off-protocol antitumor therapy (e.g., radiotherapy, chemotherapy, targeted therapy, other immunotherapies, etc.; antitumor herbal therapies require a 2-week washout period);
3. Severe grade 3 or higher irAE or severe organ damage during neoadjuvant immunotherapy;
4. Previous history of allogeneic bone marrow or organ transplantation;
5. Previous or current interstitial pneumonitis/lung disease requiring systemic hormone therapy;
6. Uncontrolled hypertension (blood pressure ≥150/90 mmHg at rest), with antihypertensive medications maintained at a stable dose for 7 days prior to the first dose of study drug;
7. Combination of other malignant tumors within 5 years prior to the first dose of study drug that require active treatment, except for tumors cured in the opinion of the investigator;
